  \"2016-07-27T22:44:59.397323\",\n\t\"name\": \"a-narrative-report-january-february-march-and-april-1960-chautauqua-national-wildlife-refu\",\n\t\"isopen\":
  false,\n\t\"url\": null,\n\t\"notes\": \"This narrative report for Chautauqua NWR
  outlines Refuge accomplishments from January through April of 1960. The report begins
  by summarizing the weather conditions, habitat conditions, water conditions, and
  food and cover during this period. Wildlife- including migratory birds, upland game
  birds, big game animals, furbearers, predators, rodents, mammals, raptors, and fish-
  is also covered. The Refuge development and maintenance section discusses physical
  developments and plantings. Resource management is outlined; topics include commercial
  fishing. A progress report on field investigations and applied research is also
  provided. The public relations section of the report describes recreational uses,
  Refuge visitors, Refuge participation, fishing, and violations. Items of interest,
  N-R forms, and photographs are attached.\",\n\t\"license_title\": \"License Not
